import axios from "axios";

const DATA_SET_API_URL = "http://localhost:8080/api/v2";

class DataSetService {
    retrieveAllDataSets() {
        return axios.get(`${DATA_SET_API_URL}/dataset`);
    }
    
    retrieveDataSet(id) {
        return axios.get(`${DATA_SET_API_URL}/dataset/${id}`);
    }
    
    deleteDataSet(id) {
        return axios.delete(`${DATA_SET_API_URL}/dataset/${id}`);
    }
    
    updateDataSet(id, dataset) {
        return axios.put(`${DATA_SET_API_URL}/dataset/${id}`, dataset);
    }
    createDataSet(dataset) {
        return axios.post(`${DATA_SET_API_URL}/dataset`, dataset);
    }
}
export default new DataSetService()
